package com.kurgan.kursach.service;import com.kurgan.kursach.models.Parking;import com.kurgan.kursach.repository.ParkingDao;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import java.util.List;@Servicepublic class ParkingServiceImpl implements ParkingService {    @Autowired    private ParkingDao parkingDao;    @Override    public void save(Parking dish_set){        parkingDao.save(dish_set);    }    @Override    public List<Parking> findAll(){        return parkingDao.findAll();    }    @Override    public void deleteById(Long id){ parkingDao.deleteById(id);}    @Override    public Parking getById(Long id) { return parkingDao.getById(id);}}